import React from 'react';
import { View, Text, Button } from 'react-native';

function Detaylar({ navigation }) {
	return (
		<View>
			<Text>Detaylar</Text>
			<Button title="Anasayfaya Git" onPress={() => navigation.navigate('Anasayfa')} />
		</View>
	);
}
export default Detaylar;
